import React from 'react';
import { NavLink } from 'react-router-dom';


export function NavBar() {
  return (
    <div>
      
      <nav>
        
        <NavLink  to="/signUp">SignUp</NavLink >
        <NavLink  to="/logIn">Login</NavLink >
      </nav>
    </div>
  );
}





